import { Link } from "react-router-dom";
import profileIcon from "./images/img2.jpeg";
import { useState,useEffect } from "react";

function Profile() {

  const [currentPassword, setCurrentPassword] = useState('');
  const [newPassword, setNewPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const imageDimensions = {
    width: "70px",
    height: "70px",
    borderRadius: "70px",
  };
  const first = sessionStorage.getItem('first_name')
  const last = sessionStorage.getItem('last_name')
    const emaill = sessionStorage.getItem('email')
    const mob = sessionStorage.getItem('mob_no')
    const gender = sessionStorage.getItem('gender')
  useEffect(() => {
    // const first = sessionStorage.getItem('first_name')
    
  }, []);
  

  return (
    <>
      <center>
        <h2>Manage your Profile</h2>
      </center>
<div style={{ justifyContent: 'center' }}>
      <div className="card text">
  <div className="card-header">
    <ul className="nav nav-pills card-header-pills">
      <li className="nav-item">
        <Link className="nav-link active" to="#"
          onClick={() => {
            document.getElementById("profileCard").hidden = true;
            document.getElementById("passwordCard").hidden = false;
          }}
        >Profile</Link>
      </li>
      <li className="nav-item">
        <Link className="nav-link" to="#">Update Profile</Link>
      </li>
      <li className="nav-item">
        <Link className="nav-link" to="#"
         onClick={() => {
          document.getElementById("profileCard").hidden = false;
          document.getElementById("passwordCard").hidden = true;
        }}
        >Change Password</Link>
      </li>
    </ul>
  </div>
  {/* ------------------------------------------------------------------------- */}
  <div id="profileCard">
  <div  className="card-body">
    <h6 className="card-title">{first} {last}</h6>
    <p className="card-text">Account Holder</p>
  </div>
  <div className="card-body">
    <h6 className="card-title">{gender}</h6>
    <p className="card-text">Gender</p>
  </div>
  <div className="card-body">
    <h6 className="card-title">{emaill}</h6>
    <p className="card-text">Email Id</p>
  </div>
  <div className="card-body">
    <h6 className="card-title">Contact No</h6>
    <p className="card-text">{mob}</p>
  </div>
  </div>
  {/* ------------------------------------------------------------------------- */}

  {/* ------------------------------------------------------------------------- */}
  <div id="passwordCard" className="col-12 d-flex justify-content-center">
      <div className="form">
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="currentPassword">Current Password</label>
            <input
              type="password"
              className="form-control"
              value={currentPassword}
              onChange={(e) => setCurrentPassword(e.target.value)}
              required
            />
          </div>

          <div className="mb-3">
            <label htmlFor="newPassword">New Password</label>
            <input
              type="password"
              className="form-control"
              value={newPassword}
              onChange={(e) => setNewPassword(e.target.value)}
              required
            />
          </div>

          <div className="mb-3">
            <label htmlFor="confirmPassword">Confirm Password</label>
            <input
              type="password"
              className="form-control"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
            />
          </div>

          <div style={{ display: 'flex', justifyContent: 'center' }}>
            <div className="mb-3">
              <button
                type="button"
                onClick={() => {
                  // Add code to navigate back or show other components.
                }}
                className="btn btn-success"
              >
                Back
              </button>
            </div>
            <div className="mb-3">
              <button type="submit" className="btn btn-success">
                Change Password
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  {/* ------------------------------------------------------------------------- */}
</div>
</div>


    </>
  );
}

export default Profile;
